                        <div class='t396__elem tn-elem tn-elem__3153667551621047436231' data-elem-id='1621047436231' data-elem-type='text' data-field-top-value="370" data-field-top-res-960-value="345" data-field-top-res-640-value="795" data-field-top-res-480-value="745" data-field-top-res-320-value="575" data-field-left-value="660" data-field-left-res-960-value="500" data-field-left-res-640-value="110" data-field-left-res-480-value="50" data-field-left-res-320-value="40" data-field-width-value="450" data-field-width-res-480-value="420" data-field-width-res-320-value="260" data-field-axisy-value="top" data-field-axisx-value="left" data-field-container-value="grid" data-field-topunits-value="px" data-field-leftunits-value="px" data-field-heightunits-value="" data-field-widthunits-value="px">
                            <div class='tn-atom' field='tn_text_1621047436231'>43 дня заданий и осознаний. Каждый день будет открываться видеоурок от 3-5 минут. Ты узнаешь, как влияют на ситуацию с деньгами те или иные установки, ситуации в жизни, как делать медитацию, чему уделить внимание в проживании осознаний<br><br>34 удивительных процесса — медитативные практики. Их ты будешь делать по специальному графику. Будут дни с двумя практиками, с одной и без медитаций<br><br>Все 43 дня тебе будет помогать проживать и осознавать процессы, погружать в них глубже Дневник Осознаний. Им можно пользоваться онлайн или распечатать<br><br>Осознание самых сокровенных своих желаний, набор энергии на их реализацию<br><br>Единомышленники и тёплое общение в чате, где ты ощутишь поддержку нон-стоп<br><br>Все инструменты с проверенным действием<br><br>Все 43 дня и ещё 10 или 15 после (в зависимости от тарифа) психолог и куратор будут поддерживать тебя<br><br><br></div>
                        </div>
