                            <div class='tn-atom' field='tn_text_1615124740418'>Создал уникальную методику, объединив медитации и психотерапию <br><br> Провёл к осознанию более 100 000 человек через свои медитации и консультации. В том числе таких звёзд, как Лилия Нилова, Саша Зверева и Полина Гагарина<br><br> Магистр психологии и социальной педагогики, клинический психолог ФМБЦ им. Бурназяна и Центральной государственной медицинской академии Управления делами Президента РФ<br><br>Член гильдии психиатрии и тренинга<br><br> Ученик Веры Савеличевой, доктора психологии Европейской академии естественных наук, основательницы научной школы интегративно-ресурсной психотерапии<br><br> Учился методике доктора медицины Райка Хамера, основателя ННМ — новой немецкой медицины<br><br>Обучался методикам Берта Хеллингера, основателя терапевтического метода системных расстановок</div>
