                                        <div class="t849__title t-name t-name_xl" field="li_title__1531218535874" style="color:#000000;font-size:18px;font-weight:400;font-family:'Montserrat';">Как будет проходить марафон?</div>
                                        <div class="t849__icon">
                                            <div class="t849__lines"> <svg width="24px" height="24px" viewBox="0 0 24 24" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink"> <g stroke="none" stroke-width="3px" fill="none" fill-rule="evenodd" stroke-linecap="square"> <g transform="translate(1.000000, 1.000000)" stroke="#e0bd60"> <path d="M0,11 L22,11"></path> <path d="M11,0 L11,22"></path> </g> </g> </svg> </div>
