                                    <div class="t849__content">
                                        <div class="t849__textwrapper">
                                            <div class="t849__text t-descr t-descr_sm" field="li_descr__1531218535874" style="color:#000000;font-size:16px;font-weight:300;font-family:'Montserrat';">Марафон будет проходить в Телеграме. Каждый день в нём будут выкладывать задания, которые ты будешь выполнять — самостоятельно или в чате с единомышленниками и в сопровождении куратора (в зависимости от выбранного тарифа). Все медитации распределены по дням, и ты последовательно будешь выполнять в удобное для себя время, опираясь на пояснения в уроке-задании. <br /><br /> В телеграм-чате «Содействие» в тёплой атмосфере участники будут общаться друг с другом и с куратором, обсуждать задания и делиться своими осознаниями и процессами. В зависимости от тарифа, тебя ждут 1 или 3 онлайн-встречи с Эдгардом, где ты сможешь выполнять практики, где Эдгард поможет прожить волнующие тебя переживания. <br /><br /> Для всех предусмотрено 4 онлайн-встречи с ответами на вопросы. <br />
                                                <ul></ul>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>
                        <div class="t-col t-col_10 t-prefix_1">
