                                            <div class="t849__text t-descr t-descr_sm" field="li_descr__1531218625139" style="color:#000000;font-size:16px;font-weight:300;font-family:'Montserrat';">23 мая или сразу после оплаты выбранного тарифа на почту, которая указана при бронировании тарифа, придёт ссылка на чат «Содействие». <br /><br /> А если в твоём тарифе предусмотрены бонусы, то доступ к некоторым из них, будет открыт с 17 мая или в течение 48 часов после оплаты марафона. <br /><br /> 25 мая моя команда отправит доступ к Дневнику и заданиям.Доступ к «Клубу Друзей» откроется с 1 июля. Сказки дядюшки Да Лад На я подарю всем, кто оплатит тариф «Расширенный» или «Персональный» с 16 по 18 мая 2021 года включительно. Всем, кто заполнил анкету предзаписи, участники «Клуба Друзей» и марафона «Я — женщина любимая моя», Сказки дядюшки Да Лад На придут в подарок при оплате до 4 мая или с 16 по 18 мая. <br /><br />
