                                            <div class="t849__text t-descr t-descr_sm" field="li_descr__1531218700960" style="color:#000000;font-size:16px;font-weight:300;font-family:'Montserrat';">Программа марафона рассчитана на 43 календарных дня. Старт марафона — 25 мая 2021 года. Марафон закончится 7 июля 2021. Все доступы к ресурсам марафона (канал с заданиями, чат поддержки) закроются 17 июля 2021 года для участников тарифов «Мини» и «Расширенный» и 22 июля 2021 для участников тарифа Персональный. <br />
