                                        <div class="t849__textwrapper">
                                            <div class="t849__text t-descr t-descr_sm" field="li_descr__1615281169110" style="color:#000000;font-size:16px;font-weight:300;font-family:'Montserrat';">Да, я всегда рад за тех, кто идёт дорогой любви к себе! И поэтому сделал для них специальную цену! Все подробности и промокод есть у администратора Клуба и куратора марафона — Анны. Пиши ей в чате, и она с удовольствием предоставит его тебе.</div>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>
                        <div class="t-col t-col_10 t-prefix_1">
                            <div class="t849__accordion t-animate" data-animate-style="fadeindown" data-animate-chain="yes" data-accordion="false">
                                <div class="t849__wrapper">
                                    <div class="t849__header " style=" border-top: 1px solid #000000">
                                        <div class="t849__title t-name t-name_xl" field="li_title__1619622671713" style="color:#000000;font-size:18px;font-weight:400;font-family:'Montserrat';">Никогда не делал(-а) медитации, подойдёт ли мне? Как лучше всего делать медитации? Если я усну или не успею выполнять задания каждый день?</div>
                                        <div class="t849__icon">
                                            <div class="t849__lines"> <svg width="24px" height="24px" viewBox="0 0 24 24" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink"> <g stroke="none" stroke-width="3px" fill="none" fill-rule="evenodd" stroke-linecap="square"> <g transform="translate(1.000000, 1.000000)" stroke="#e0bd60"> <path d="M0,11 L22,11"></path> <path d="M11,0 L11,22"></path> </g> </g> </svg> </div>
                                            <div class="t849__circle" style="background-color: #fbfbfb"></div>
                                        </div>
                                        <div class="t849__icon t849__icon-hover">
                                            <div class="t849__lines"> <svg width="24px" height="24px" viewBox="0 0 24 24" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink"> <g stroke="none" stroke-width="3px" fill="none" fill-rule="evenodd" stroke-linecap="square"> <g transform="translate(1.000000, 1.000000)" stroke="#fbfbfb"> <path d="M0,11 L22,11"></path> <path d="M11,0 L11,22"></path> </g> </g> </svg> </div>
                                            <div class="t849__circle" style="background-color: #e0bd60"></div>
                                        </div>
                                    </div>
                                    <div class="t849__content">
                                        <div class="t849__textwrapper">
                                            <div class="t849__text t-descr t-descr_sm" field="li_descr__1619622671713" style="color:#000000;font-size:16px;font-weight:300;font-family:'Montserrat';">Я рекомендую медитации делать сидя. Ты будешь чувствовать себя и скоро найдёшь оптимальный способ. Кто-то делает лежа, кто-то во время ходьбы или стоя. Даже если ты уснёшь, все процессы пройдут в твоём подсознании всё равно. Это значит, что сейчас осознать этот процесс сложно, в нём много боли. Если ты пропустишь несколько дней, ты просто продолжишь с того дня, где остановился(-ась). Именно поэтому поддержка куратора будет ещё 10 и 15 дней, в зависимости от выбранного тарифа.</div>
